import React, {useState} from 'react';
import './App.css';

function App() {
	let [a, b] = useState([1,2]);
	return (
		<div className="App">
			<div>
				<p onClick={()=>{b(a+1)}}>asdasdasd</p>
				<p>{a}</p>
			</div>
		</div>
	);
}

export default App;
